import React, { Component } from "react";
import { Navbar, Nav, NavItem, NavLink } from "reactstrap";

class LeftNav extends Component {
  state = {};

  styleNavBar = {
    paddingLeft: 0,
    paddingRight: 0,
    paddingBottom: 0,
    borderRight: "solid 1px #d1d1d1",
    border: "double"
  };
  styleNavItem = {
    borderBottom: "solid 1px double #d1d1d1"
  };

  render() {
    return (
      <Navbar style={this.styleNavBar}>
        <Nav vertical>
          <NavItem style={this.styleNavItem}>
            <NavLink href="#">Link</NavLink>
          </NavItem>
          <NavItem style={this.styleNavItem}>
            <NavLink href="#">Link</NavLink>
          </NavItem>
          <NavItem style={this.styleNavItem}>
            <NavLink href="#">Link</NavLink>
          </NavItem>
        </Nav>
      </Navbar>
    );
  }
}

export default LeftNav;
